import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


const utente = {
  nome: 'Elena',
  cognome: 'Signore'
};

function formattaNome(utente) {
  return utente.nome + ' ' + utente.cognome;
}

const element = <h1>Hello, {formattaNome(utente)}</h1>;

ReactDOM.render(
  element,
  document.getElementById('root')
);
